import React, { PureComponent } from 'react';
import styled from '@emotion/styled';

const HeaderContainer = styled.header`
    display: flex;
    align-items : center;
    justify-content : center;
`;

const Img = styled.img`
    width: 50px;
`;

const Header = () => {
    return (
        <HeaderContainer>
            <img src="logo.png" alt="" srcset=""/>
        </HeaderContainer>
    );
}

export default Header;
